import React from 'react';
import AddUser from './components/AddUser/AddUser';
import UserList from './components/UserList/UserList';
function App() {
  let data = [];
  const collectedData = (data) => {
    // console.log(data);
    // data.push(data);

    if (data.length === 0) {
      console.log('Input is empty');
    } else if (data.Age <= 0 || data.Age >= 110) {
      console.log('Invalid age field');
    } else {
      data.push(data);
     };
}  
  return (
    <div>
      <AddUser onAddData={collectedData } />
      <UserList dataToRender={data} />
    </div>
  );
}

export default App;
